import React from 'react';
import {AppBar, Toolbar,CssBaseline,Typography} from "@material-ui/core";
import useStyles from './stylesHeaderTry';
import { Link } from "react-router-dom";

function HeaderTry() {

  const classes = useStyles();
  return (
      <>
        <AppBar position="static">
            <CssBaseline />
            <Toolbar>
                    <ul className={classes.navLinks}>
                       <li className={classes.link} > <a href="#hero">Home</a></li>
                       <li className={classes.link}> <a href="#posts">View Posts</a></li>
                       <li className={classes.link}> <a href="#form">Add Post</a></li>
                    </ul>
            </Toolbar>
        </AppBar>
      </>
  );
}

export default HeaderTry;
